import { NavLink } from "react-router-dom";
import classes from "./MainNavigation.module.css";

const MainNavigation = () => {
  return (
    <ul className={classes.nav}>
      <li>
        <NavLink to="/" activeClassName={classes.active}>Home</NavLink>
      </li>
      <li>
        <NavLink to="/about" activeClassName={classes.active}>About Me</NavLink>
      </li>
      <li>
        <NavLink to="/projects" activeClassName={classes.active}>Projects</NavLink>
      </li>
      <li>
        <NavLink to="/contact" activeClassName={classes.active}>Contact</NavLink>
      </li>
    </ul>
  );
};

export default MainNavigation;
